import Liability from "./Liability";

const Liabilities = ({
  short_term,
  long_term_debt,
  is_editing,
  formatToCurrency,
  toggleEditing,
  currency,
  currency_codes
}) => {
  return (
    <table className="table">
      <tbody>
        <tr>
          <th>Short Term Liabilities</th>
          <th>Monthly Payment</th>
          <th></th>
        </tr>
        {short_term.map(liability => (
          <Liability
            liability={liability}
            key={liability.id}
            is_editing={is_editing}
            formatToCurrency={formatToCurrency}
            toggleEditing={toggleEditing}
            currency={currency}
            currency_codes={currency_codes}
          />
        ))}
        <tr>
          <th>Long Term Debt</th>
          <th></th>
          <th></th>
        </tr>
        {long_term_debt.map(liability => (
          <Liability
            liability={liability}
            key={liability.id}
            is_editing={is_editing}
            formatToCurrency={formatToCurrency}
            toggleEditing={toggleEditing}
            currency={currency}
            currency_codes={currency_codes}
          />
        ))}
      </tbody>
    </table>
  );
};

export default Liabilities;
